--
-- Procedimientos
--
CREATE DEFINER=`areasist_admindb`@`localhost` PROCEDURE `sp_materias_a_rendir` (IN `legajo` INT(11))  NO SQL
BEGIN
		SELECT m.codigo_carrera, c.nombre as nombre_carrera, m.codigo_materia,  m.nombre as nombre_materia, e.fecha_1, e.fecha_2, f.fecha_final from libro_matriz l1
			inner join materias m on m.codigo_materia=l1.codigo_materia and l1.codigo_carrera = m.codigo_carrera
			inner join examenes e on e.codigo_materia = m.codigo_materia and e.codigo_carrera = m.codigo_carrera 
			inner join carreras c on c.codigo_carrera = m.codigo_carrera
            left join inscripciones_finales f on f.legajo = l1.legajo and f.codigo_carrera = c.codigo_carrera and f.codigo_materia = m.codigo_materia
			where l1.legajo = legajo and l1.regular =1 and l1.nota_final<4  
			and YEAR(NOW()) <= YEAR(DATE_ADD(l1.fecha_regular, interval 5 year))
            and l1.codigo_materia not in 
			(	
				select c.codigo_materia from correlativas c 
				where c.codigo_carrera = l1.codigo_carrera and c.codigo_correlativa 
			    not in 
			    (
					select l.codigo_materia 
					from libro_matriz l 
			        where l.regular = 1 and l.nota_final>=4 and l.legajo = l1.legajo and l.codigo_carrera = l1.codigo_carrera
				)
			);
END$$

